template <class T>
struct custom_round : std::binary_function<T, int, T>
{
    inline T operator()(const T& __x, const int& __y) const
    {
        T places = pow(10.0, __y);
        T value = __x;
        T rounded = (round(value * places) / places);
        return rounded;
    }
};

template <class T>
struct boxcox : std::binary_function<T, T, T>
{
    inline T operator()(const T& __x, const T& __y) const
    {
        if(__y == 0)
        {
          T boxcox = (T)log((double)__x);
          return boxcox;
        }
        else
        {
           T boxcox = (T)((pow((double)__x,(double)__y)-(double)1.0)/(double)__y);
           if(!isfinite(boxcox))
           {
              cout << "Negative values are not allowed" << endl;
              exit(0);
           }
           return boxcox;
        }
    }
};

inline float encode(string& s)
{
  int sz = s.size();
  if(sz>2)
  {
    cout << "Only expected codes of less than 2 chars!" << endl;
    exit(0);
  }
  float r = 0.0f;
  for(int i=0; i < sz; i++)
        r += (int(s[i])-int('A')+1)*pow(26.0,(sz-i-1));
  return r;

}


vector<float> StandardScaler(vector<float>&o, pair<float, float>& meanandstddev, bool rescale=true)
{
    double mean = meanandstddev.first;
    double stddev;
    stddev = meanandstddev.second;
    vector<double> v(o.begin(), o.end());
    if(rescale)
    {
        double sum = std::accumulate(v.begin(), v.end(), 0.0);
        mean = sum / v.size();
        std::vector<double> diff(v.size());
        std::transform(v.begin(), v.end(), diff.begin(),
                       std::bind2nd(std::minus<double>(), mean));
        double sq_sum = std::inner_product(diff.begin(), diff.end(), diff.begin(), 0.0);
        stddev = std::sqrt(sq_sum / v.size());
        meanandstddev.first = float(mean);
        meanandstddev.second = float(stddev);
    }

    if(mean!=0)
    {
        transform(v.begin(), v.end(), v.begin(),
                  bind2nd(std::plus<double>(), -mean));
    }
    if(stddev!=0)
    {
        transform(v.begin(), v.end(), v.begin(),
                  bind2nd(std::divides<double>(), stddev));
    }

    vector<float> newO(v.begin(), v.end());
    return newO;
}

unordered_map<string, vector<float>> MungeData(unordered_map<string, vector<float>>&data)
{

  unordered_map<string,double> boxcoxcoeffs = {{"cont1", -0.58508489519696261},
                                               {"cont4", -0.99519798179750019},
                                               {"cont5", -3.0078793688672452},
                                               {"cont6", -0.95237905372006504},
                                               {"cont7", -2.2837778626973422},
                                               {"cont8", -2.2790172483888846},
                                               {"cont9", -2.563116663256249},
                                               {"cont10", -0.61389183325875618},
                                               {"cont11", -0.43737234048537144},
                                               {"cont12", -0.47055182116046651},
                                               {"cont13", -1.4408255185099244},
                                               {"cont14", -0.8989546613840621}};
    for(auto p: boxcoxcoeffs)
    {
        transform(data[p.first].begin(),
                  data[p.first].end(),
                  data[p.first].begin(),
                  bind2nd(boxcox<double>(), p.second));
    }
    vector<string> allkeys;
    for(auto p: data)
    {
      if(p.first!="id"&&p.first!="loss")
        allkeys.push_back(p.first);
    }

    //Scaling
    unordered_map<string, vector<float>> scaleddata;
    for(auto&x : allkeys) {

        pair<float, float> meanandstddev(0, 0);
        scaleddata[x] = StandardScaler(data[x], meanandstddev, true);
        transform(scaleddata[x].begin(),
                  scaleddata[x].end(),
                  scaleddata[x].begin(),
                  bind2nd(custom_round<float>(), 6));


    }
    return scaleddata;

}

void ImportData(string inputfileName,
                unordered_map<string, vector<float>>&data,
                vector<string>&ids,
                vector<float>&losses)
{
    cout << endl << inputfileName << endl;
    string line;
    vector<string> header;
    ifstream stream(inputfileName);
    if(stream.good())
    {
        bool isHeader = true;
        int noOfEntries = 0;
        while(getline(stream, line))
        {
            if(isHeader)
            {

                vector<string> rawHeader = tokenizeString(line.c_str(),',',false);
                for(auto& x : rawHeader)
                {
                    header.push_back(x);
                }
                isHeader=false;
            }
            else
            {

                noOfEntries++;
                if (noOfEntries % 100000 == 0)
                {
                    cout << endl << noOfEntries << endl;
                    cout.flush();
                }
                else if (noOfEntries % 2000 == 0)
                {
                    cout << ".";
                    cout.flush();
                }

                vector<string> lineData  = tokenizeString(line.c_str(),',',false);
                int column = 0;
                for(auto &x : lineData)
                {


                    if(header[column]=="id")
                    {
                        ids.push_back(x);
                    }
                    else if(header[column]=="loss")
                    {

                        losses.push_back(stof(x)); 
                    }
                    else if(header[column].find("cat")!=string::npos)
                    {
                         data[header[column]].push_back(encode(x));
                    }
                    else
                    {

                        data[header[column]].push_back(stof(x)+1);
                    }
                    
                    column++;

                }
                
                
            }
        }


    }
    else
    {
        cout << "File doesn't exist" << endl;
    }
}

void DumpPredictions(string& trainfileName, vector<string>& trainids,
                     vector<float>& trainlosses,
                     string& testfileName, vector<string>& testids,
                     unordered_map<string, vector<float>>& data)
{
    cout << endl << trainfileName << endl;
    ofstream train(trainfileName,std::ofstream::out | std::ofstream::trunc);
    if(!train) {
        cout << "Cannot open train file.\n";
        return;
    }

    cout << endl << testfileName << endl;
    ofstream test(testfileName,std::ofstream::out | std::ofstream::trunc);
    if(!test) {
        cout << "Cannot open test file.\n";
        return;
    }
    train << std::setprecision(6);
    train << std::fixed;
    test << std::setprecision(6);
    test << std::fixed;

    train << "id,p1,p2,p3,p4,p5,p6,p7,p8,p9,p10,loss" << endl;
    test << "id,p1,p2,p3,p4,p5,p6,p7,p8,p9,p10" << endl;

    unsigned int rows = (unsigned int) data["cat1"].size();
    cout << "TotalRows: " << rows << endl;
    cout << "Train Ids: " << trainids.size() << endl;
    cout << "Train Losses: : " << trainlosses.size() << endl;
    cout << "Test Ids: " << testids.size() << endl;

    unsigned int noOfEntries = 0;
    unsigned int trainingsize = trainlosses.size();

    for(unsigned int row = 0; row < rows; row++)
    {
        noOfEntries++;
        if (noOfEntries % 100000 == 0)
        {
            cout << endl << noOfEntries << endl;
            cout.flush();
        }
        else if (noOfEntries % 2000 == 0)
        {
            cout << ".";
            cout.flush();
        }

        if(row < trainingsize)
        {
            train << trainids[row] << ",";
        }
        else
        {
            test << testids[row-trainingsize] << ",";
        }
        
        float p1 = fitPrediction1(data, row);
        float p2 = fitPrediction2(data, row);
        float p3 = fitPrediction3(data, row);
        float p4 = fitPrediction4(data, row);
        float p5 = fitPrediction5(data, row);
        float p6 = fitPrediction6(data, row);
        float p7 = fitPrediction7(data, row);
        float p8 = fitPrediction8(data, row);
        float p9 = fitPrediction9(data, row);
        float p10 = fitPrediction10(data, row);
                
        if(row < trainingsize)
        {
          train << p1 << "," << p2 << "," << p3  << "," << p4 << "," << p5 << ",";
          train << p6 << "," << p7 << "," << p8 << "," << p9 << "," << p10 << ",";
          train << trainlosses[row] << endl;
        }
        else
        {
          test << p1 << "," << p2 << "," << p3  << "," << p4 << "," << p5 << ",";
          test << p6 << "," << p7 << "," << p8  << "," << p9 << "," << p10 <<  endl;
        }  

    }
    cout << endl;
    train.close();
    test.close();

}

